import './App.css';

function App() {
  return (
    <div className="App">
      <div className="datos">
        <label>Nombre:<input type="text"/></label>
        <label>Edad:<input type="text"/></label>
        <label>País:<input type="text"/></label>
        <label>Cargo:<input type="text"/></label>
        <label>Años:<input type="text"/></label>
      </div>
    </div>
  );
}

export default App;
